    //  输入一个正整数 target ，输出所有和为 target 的连续正整数序列（至少含有两个数）。
    //      序列内的数字由小到大排列，不同序列按照首个数字从小到大排列。

    public static int[][] findContinuousSequence(int target) {
        List<int[]> ret = new ArrayList<>();

        for (int i = target / 2; i >= 2; i--) { // i为有几个
            if ((target - calcNum(1, i - 1, 1)) % i == 0) {
                int startTmp = (target - calcNum(1, i - 1, 1)) / i;
                if (startTmp <= 0) {
                    continue;
                }
                int[] list = new int[i];
                for (int j = startTmp; j < startTmp + i; j++) {
                    list[j - startTmp] = j;
                }
                ret.add(list);
            }
        }
        int[][] res = new int[ret.size()][];
        for (int i = 0; i < ret.size(); i++) {
            res[i] = ret.get(i);
        }
        return res;
    }

    //    等差数的和计算 5,6 差1  5,6,7差3
    public static int calcNum(int begin, int end, int diff) {
        return ((end - begin) / diff + 1) * (begin + end) / 2;
    }

    //  最长的无重复的子串
    public static int lengthOfLongestSubstring(String s) {
        if(s.length()==1){
            return 1;
        }
        int length = s.length();
        int res = 0;
        Set<Character> set = new HashSet<>();
        Set<Character> loop =  new HashSet<>();

        for (int i = 0; i < length - 1; i++) {  //  优化不用set做存储
            set.clear();
            set.add(s.charAt(i));
            for (int j = i+1; j <= length; j++) {
                res = Math.max(res, set.size());
                if (j == length){
                    set.clear();
                }else{
                    if(set.contains(s.charAt(j))){
                        break;
                    }
                    set.add(s.charAt(j));
                }
            }
        }
        return res;
    }

